INSERT INTO `paragraphs` VALUES (1,'{\"id\":1,\"content\":\"La partie est terminée.\"}',1),(2,'{\"id\":2,\"content\":\" Vous avez perdu ! \"}',1),(3,'{\"id\":3,\"content\":\"Vous n’arriverez jamais à l’accueil du jeu. Vous êtes prisonnier du métavers Zera. Les développeurs vous ont envoyé malencontreusement dans les méandres du code qui compose Zera. Personne ne peut plus vous identifier ni vous aider. \"}',1),(4,'{\"id\":4,\"content\":\"Recommence le livre depuis l\'introduction afin de découvrir d’autres combinaisons dans Zera. Bonne chance ! \"}',1),(5,'{\"id\":1,\"content\":\"Tu es prêt à entrer dans le jeu, car l’installation a fonctionné. Tu regardes l’heure en bas de l’écran de l’ordinateur. Ta mère a oublié de regarder sa montre et ne s’est pas rendu compte que tu es resté plus longtemps que prévu devant l’ordinateur. Tu as le choix entre te connecter tout de suite sur le site de Zera pour démarrer une partie ou fermer toutes les fenêtres sur l’ordinateur et remettre ta première partie de jeux dans le métavers à une prochaine fois.\"}',2),(6,'{\"id\":1,\"content\":\"Tu ne réfléchis plus, tu n’arrives pas à te retenir ! En parler à ta mère serait risqué car elle te dirait sûrement non. Tu décides de te connecter sur le site du métavers Zera. Tu te crées rapidement un compte en entrant l’adresse email de ton père ainsi que le code que tu as recopié depuis la vidéo. Le site te demande de valider la création de ton compte gratuit. Pour cela, tu dois entrer dans la boîte de réception des emails de tes parents. C’est facile, tu as déjà vu Papa le faire, tu cliques sur la petite enveloppe en bas de l’écran.\"}',3),(7,'{\"id\":2,\"content\":\"Une fois arrivé dans la boîte à courriers électroniques de ton père, tu trouves un email qui s’affiche en gras. Ce message s’appelle : Notification / Important : Email Confirmation Register Zeta Metaverse Immersive World Box. Tu cliques dessus. Le corps du texte est en anglais, mais un call to action semble évident : un bouton bleu avec le mot “click to confirm” en gras est mis en évidence au milieu de l’écran. Tu cliques dessus en espérant ne pas avoir fait une erreur.\"}',3),(8,'{\"id\":3,\"content\":\"Tu trépignes d’impatience tellement tu es excité à l’idée de pouvoir tester le jeu. Il faut bien reconnaître que le fait de lancer l’installation seul, en cachette, revient à braver les interdits. Cela te procure un sentiment mêlant stress, excitation et joie intense. Tu sens que tu entres dans la cour des grands. Toi aussi, tu rêves d’être un gamer et un hacker.\"}',3),(9,'{\"id\":4,\"content\":\"Tout a fonctionné. Tu as créé un compte avec succès sur le site www.zetaworldbox.metaverse.com . \"}',3),(10,'{\"id\":1,\"content\":\"Cette vidéo est à la hauteur de ce que t’ont raconté tes copains. Le jeune adulte qui l’a réalisé se met lui-même en scène dans une vidéo de 15 minutes environ. Il alterne entre des parties où il se filme pour expliquer comment marche l’extension et à quoi elle sert, des parties où il montre son écran lors des différentes phases du téléchargement et de l’installation de l’extension Zera Magic Code Finder et de courts extraits vidéos du jeu.\\nTu découvres qu’il est possible d’intégrer le métavers Zera à travers plusieurs époques telles que la Californie à l’époque Western ( 19e siècle), la Cybercité dans un monde futuriste, la jungle tropicale d’Amérique du sud à notre époque ou encore l’immense Marketplace Futuro où sont répertoriés et entreposés tous les articles vendus sur internet.\"}',4),(11,'{\"id\":2,\"content\":\"Les extraits du jeu vidéo te fascinent immédiatement. Les décors et les personnages sont ultra-réalistes. Les actions possibles dans le métavers sont pratiquement infinies. Tu trépignes d’impatience de pouvoir y jouer.\"}',4),(12,'{\"id\":3,\"content\":\"La vidéo se conclut avec une explication simple des étapes à suivre pour procéder à l’installation de l’extension Zera Magic Code Finder, tu notes tout dans ton carnet secret avec ton stylo préféré. Sans oublier le plus important: le code promo qui te permettra de jouer dans le métaverse Zera gratuitement.\"}',4),(13,'{\"id\":4,\"content\":\"Tu te retrouves face à un dilemme.\"}',4),(14,'{\"id\":5,\"content\":\"Si tu télécharges l\'extension maintenant, tu pourras avoir assez de temps pour essayer le code et découvrir le métavers Zera dès ce soir ! Papa et Maman risquent de ne pas être contents de découvrir que tu as téléchargé quelque chose sans leur permission. Ils risqueraient de ne plus te faire confiance pour te prêter l’ordinateur par la suite. En effet, télécharger une extension ou un logiciel gratuit sur internet peut s’avérer dangereux pour la sécurité de l’ordinateur familial. Pourquoi ? Certains logiciels sont tout simplement malveillants, c\'est-à-dire que des virus peuvent s’installer par la même occasion sur l’ordinateur, ou encore pire : voler des informations confidentielles enregistrées dans la mémoire de la machine ou effacer des données.\"}',4),(15,'{\"id\":1,\"content\":\"Tu rentres en voiture de l’école avec ta maman et ton petit frère Mike. Ce dernier s’est endormi dans la voiture. Mike a cinq ans, il ne fait plus la sieste et il n’est pas rare qu’il s’endorme durant les 20 minutes de trajet qui séparent ta maison de votre école.\"}',5),(16,'{\"id\":2,\"content\":\"Mike et toi avez pour habitude de prendre votre goûter dans la cuisine avec votre mère avant de faire tes devoirs en autonomie. Si tu les fais rapidement tu auras le temps d’aller faire d’autres activités. Aujourd’hui c’est mardi  et comme demain il n’y a pas école, tu as le droit de prendre l’ordinateur pendant  30 minutes après avoir révisé tes leçons et fais tes devoirs.\"}',5),(17,'{\"id\":3,\"content\":\"Tu te mets face à tes  exercices de mathématiques dans ta chambre, une fois que tu les as  terminés, tu appelles ta mère pour qu’elle vienne contrôler tes réponses. Comme d\'habitude, tu as bien travaillé. Après avoir corrigé quelques erreurs avec ta mère, tu ranges tes affaires dans ton sac à dos. \"}',5),(18,'{\"id\":4,\"content\":\" “    -C’est très bien ! Tu peux aller jouer.\\n      -Maman, est-ce que je peux avoir l’ordinateur ?  \\n      -Oui d’accord, mais que veux-tu faire sur l’ordinateur ? \\n      -Je voudrais regarder des vidéos sur YouTune, je peux \\n       s’il te plait ?\\n      -Quel genre de vidéos exactement ?\\n      -Des vidéos qui parlent de jeux vidéos western comme. \\n       j’ai regardé l’autre jour !\\n      -Je suis d’accord. Je te laisse 30 minutes maximum, \\n       après je le passerai à ton petit  frère pour qu’il \\n       regarde son dessin animé.”\"}',5),(19,'{\"id\":5,\"content\":\"Tu pars dans le bureau de ton père afin de chercher l’ordinateur portable que toute la famille utilise. En général tu l’utilises uniquement pour regarder des dessins animés ou des vidéos. Si tu souhaites télécharger un jeu ou une application tu dois demander l’autorisation à tes parents.  Tu t’installes confortablement dans ton lit et disposes l’ordinateur face à toi. Tu seras tranquille, car Mike est occupé à jouer dans le salon. \"}',5),(20,'{\"id\":6,\"content\":\"Tu as une idée précise de ce que tu vas regarder car ce matin, tes copains t’ont parlé d’une vidéo durant la récréation. Il s\'agit d’un Youtuneur qui donne des codes d’accès pour installer une extension au moteur de recherche. Cette extension permet de taper des codes qui donnent accès à différentes maps dans le métavers Zera. On peut y incarner différents personnages dans différents mondes virtuels. Et tout ça gratuitement ! Tu tapes les mots “ code métavers Zera gratuit” dans la barre de recherche de Youtune. Tu trouves facilement la vidéo en question parmi les premières propositions et tu cliques dessus pour la regarder. \"}',5),(21,'{\"id\":7,\"content\":\"Tu baisses le volume du son car tu sais bien que maman (et encore moins papa) ne serait pas forcément d’accord pour que tu regardes ce type de contenu.\"}',5);

